import React from 'react';

// == Import Styled
import HomePageStyled from './HomePageStyled';

const HomePage = () => {
  return (
    <HomePageStyled>
      <header className="header">

      </header>
      <section id="intro-zn">
        <img src={process.env.PUBLIC_URL + '/img/grain-de-vrac-broderie-hp.jpg'} alt="broderie du logo Grain de Vrac"/>
        <div className="intro-zn--text-zn">
          <h1 className="main-title">Grain de Vrac</h1>
          <p className="intro-zn--text-zn--content">est une épiceire itinérante de vrac située dans les Landes. Retrouvez-nous sur un marché près de chez vous ou en livraison à votre porte !</p>
          <button className="intro-zn--text-zn--button">En savoir plus !</button>
        </div>

      </section>

      <section id="special-alert-zn"></section>

      <section id="planning-zn"></section>

      <section id="highlighted-products-zn"></section>

      <section id="contact-zn"></section>
      <footer className="footer"></footer>
    </HomePageStyled>
  );
};

export default HomePage;
